import { useState } from "react";
import API from "../api";
import { useNavigate } from "react-router-dom";

function Register() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("user");
  const navigate = useNavigate();

  const registerUser = async () => {
    try {
      await API.post("/register", { email, password, role });
      alert("Registered Successfully");
      navigate("/");
    } catch (err) {
      alert("Registration Failed");
    }
  };

  const styles = {
    container: {
      minHeight: "100vh",
      backgroundColor: "#0a0a0a",
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      fontFamily: "'Inter', sans-serif",
      color: "#ffffff",
      padding: "20px",
    },
    card: {
      backgroundColor: "#161616",
      padding: "40px",
      borderRadius: "16px",
      border: "1px solid #2a2a2a",
      width: "100%",
      maxWidth: "420px",
      boxShadow: "0 20px 40px rgba(0,0,0,0.4)",
    },
    title: {
      fontSize: "28px",
      fontWeight: "700",
      marginBottom: "8px",
      textAlign: "center",
    },
    subtitle: {
      fontSize: "14px",
      color: "#666",
      textAlign: "center",
      marginBottom: "32px",
    },
    label: {
      display: "block",
      fontSize: "12px",
      fontWeight: "600",
      color: "#888",
      marginBottom: "8px",
      textTransform: "uppercase",
      letterSpacing: "0.5px",
    },
    inputGroup: {
      marginBottom: "20px",
    },
    input: {
      width: "100%",
      padding: "12px 16px",
      backgroundColor: "#000000",
      border: "1px solid #333",
      borderRadius: "8px",
      color: "#fff",
      fontSize: "16px",
      outline: "none",
      transition: "border-color 0.2s ease",
      boxSizing: "border-box",
    },
    select: {
      width: "100%",
      padding: "12px 16px",
      backgroundColor: "#000000",
      border: "1px solid #333",
      borderRadius: "8px",
      color: "#fff",
      fontSize: "16px",
      outline: "none",
      cursor: "pointer",
      appearance: "none", // Removes default arrow for a cleaner look
    },
    button: {
      width: "100%",
      padding: "14px",
      backgroundColor: "#ffffff",
      color: "#000000",
      border: "none",
      borderRadius: "8px",
      fontSize: "16px",
      fontWeight: "600",
      cursor: "pointer",
      marginTop: "10px",
      transition: "opacity 0.2s ease",
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.title}>Create Account</h2>
        <p style={styles.subtitle}>Join our professional healthcare network</p>

        <div style={styles.inputGroup}>
          <label style={styles.label}>Email Address</label>
          <input
            placeholder="name@company.com"
            style={styles.input}
            onChange={(e) => setEmail(e.target.value)}
            onFocus={(e) => (e.target.style.borderColor = "#ffffff")}
            onBlur={(e) => (e.target.style.borderColor = "#333")}
          />
        </div>

        <div style={styles.inputGroup}>
          <label style={styles.label}>Password</label>
          <input
            type="password"
            placeholder="••••••••"
            style={styles.input}
            onChange={(e) => setPassword(e.target.value)}
            onFocus={(e) => (e.target.style.borderColor = "#ffffff")}
            onBlur={(e) => (e.target.style.borderColor = "#333")}
          />
        </div>

        <div style={styles.inputGroup}>
          <label style={styles.label}>Account Type</label>
          <div style={{ position: "relative" }}>
            <select 
              style={styles.select} 
              onChange={(e) => setRole(e.target.value)}
            >
              <option value="user">Patient / User</option>
              <option value="doctor">Medical Doctor</option>
            </select>
            {/* Minimalist custom arrow icon */}
            <div style={{
              position: "absolute", right: "15px", top: "50%", 
              transform: "translateY(-50%)", pointerEvents: "none", color: "#666"
            }}>▾</div>
          </div>
        </div>

        <button 
          style={styles.button} 
          onClick={registerUser}
          onMouseOver={(e) => (e.target.style.opacity = "0.9")}
          onMouseOut={(e) => (e.target.style.opacity = "1")}
        >
          Create Account
        </button>
      </div>
    </div>
  );
}

export default Register;
